import React from "react";
import 'boxicons';

export default function List () {
    const obj= [
        {
            color: '#f9c74f',
            name: 'Savings',
            
        },
    
        {
            color: 'rgb(54, 162, 235)',
            name: 'Investments',
           
        },
    
        {
            color: 'rgb(54, 162, 235)',
            name: 'Expenses',
        },
    ]


    return(
       <div className="flex flex-col py-6 gap-3">
           <h1 className="py-4 text-md font-bold text-xl">Transaction History</h1>
          {obj.map((v,i) =><Transaction key={i} category = {v}></Transaction>)}
       </div>
    )
}

function Transaction({category}){
    if(!category)return null;
    return(
        <div className="item flex justify-center bg-gray-50 py-3 rounded-r" style={{borderRight:`8px solid ${category.color??"#e5e5e5"}`}}>
            <button className="px-3"><box-icon size="15px" name='trash'></box-icon></button>
            <span className="block w-full">{category.name??""}</span>
        </div>
    )
}
